import React from "react";
import { Container, Typography } from "@material-ui/core";
import Masonry from "react-masonry-css";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';

import product1 from "../Assets/Products/product1.jpg";
import product2 from "../Assets/Products/product2.jpg";
import product3 from "../Assets/Products/product3.jpg";
import product4 from "../Assets/Products/product4.jpg";
import product5 from "../Assets/Products/product5.jpg";
import product6 from "../Assets/Products/product6.jpg";
import product7 from "../Assets/Products/product7.jpg";
import product8 from "../Assets/Products/product8.jpg";
import product9 from "../Assets/Products/product9.jpeg";



const useStyles = makeStyles({
    root: {
      maxWidth: 345,
    },
    media: {
      height: 140,
    },
  });

  
const cardsDate = [
  {
    id: 1,
    img: product1,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 2,
    img: product2,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 3,
    img: product3,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 4,
    img: product4,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 5,
    img: product5,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 6,
    img: product6,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 7,
    img: product7,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 8,
    img: product8,
    title: "hgvhgc",
    description: "vghcg",
  },
  {
    id: 9,
    img: product9,
    title: "hgvhgc",
    description: "vghcg",
  },
];

const Products = () => {
  return (
    <div>
      <Container>
        <Masonry>
            breakpointsCol={3}
            className='my-masonry-grid'
            columeClassName="my-masonry-grid_column"

          {cardsDate.map((card) => (
            <div key={card.id}>
              <img width='100px' src={card.img} alt={card.title} />
              <Typography> {card.title}</Typography>
            </div>
          ))}
        </Masonry>
      </Container>
      <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="/static/images/cards/contemplative-reptile.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Lizard
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
    </div>
  );
};

export default Products;
